import React from 'react';
import * as ReactDOMClient from 'react-dom/client';

const helptext = "Help Text"
function Header() {
    return (
        <header>шапка профиля</header>
    )
} 

function App() {
    return ( 
    <div>
        <Header />
        <Header />
        <h1>{helptext}</h1>

    </div>

)
}

const app = ReactDOMClient.createRoot(document.getElementById("app"))
app.render(<App/>)
